import React from "react"
import { NavLink } from "react-router-dom"

import fflogo from "../images/ff-logo.svg"

import {
  Segment,
} from "semantic-ui-react"


const Footer = () => {
  return (
    <div id="footer">
        <Segment color='black'>
            <div id='inner-footer'>
                <h5>Fortisure ITFortisure Foods</h5>
                <h5>Why We Do It</h5>
                <p> | Work With Us</p>
            </div>
        
        </Segment>
    </div>
  )
}

export default Footer
